import "./Button_style.scss";
import { GrPowerReset } from "react-icons/gr";

import React from "react";

const Button = () => {
  return (
    <div>
      <div className="btn">
        <GrPowerReset size={25} style={{ color: "blue" }} className="reset" />
      </div>
    </div>
  );
};

export default Button;
